export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:d,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:d,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:d,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},luf9G7j12I:{data:{id:1393,attributes:{imdbId:"tt1519931",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTk2MzM4MjA5Nl5BMl5BanBnXkFtZTcwNjk5Njk1Mw@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.5\u002F10"}],item_lang:{data:{id:2056,attributes:{title:"Haven",plot:"She has no past. She has no family. She was raised in an orphanage. So, she lives for what she does best: be an FBI agent. That's why Audrey Parker is sent to a distant Maine village called Haven, to investigate the crime of a prison fugitive. What she does not know, is that her past is connected to that village, that old threats from the past are coming back, and she is going to be a central piece on everyone's life... or death.",slug:"haven"}}},books:{data:[{id:1027,attributes:{title:g,description:"Stephen King's bestselling unsolved mystery, THE COLORADO KID -- inspiration for the TV series HAVEN -- returns to bookstores for the first time in 10 years in an all-new illustrated edition. On an island off the coast of Maine, a man is found dead. There's no identification on the body. Only the dogged work of a pair of local newspapermen and a graduate student in forensics turns up any clues, and it's more than a year before the man is identified. And that's just the beginning of the mystery. Because the more they learn about the man and the baffling circumstances of his death, the less they understand. Was it an impossible crime? Or something stranger still...? No one but Stephen King could tell this story about the darkness at the heart of the unknown and our compulsion to investigate the unexplained. With echoes of Dashiell Hammett's THE MALTESE FALCON and the work of Graham Greene, one of the world's great storytellers presents a moving and surprising tale whose subject is nothing less than the nature of mystery itself...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DPlOEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2019-05-07",publisher:"Titan Books (US, CA)",subtitle:e}},{id:1028,attributes:{title:h,description:"Auf einer Insel vor der Küste des US-Bundesstaates Maine wird eine männliche Leiche gefunden, die nicht identifiziert werden kann. Ein paar hartnäckige Lokaljournalisten recherchieren den Fall, aber je mehr Spuren sie verfolgen, desto geheimnisvoller wird das Ganze. Handelt es sich um ein schier unmögliches Verbrechen? Oder sogar um etwas noch Befremdlicheres ...?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=O47oRx8mpWoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2009-10-02",publisher:"Heyne Verlag",subtitle:"Roman"}},{id:1029,attributes:{title:h,description:"«Colorado Kid tiene las virtudes de las viejas historias de suspense. Aquí es donde empecé, y estoy encantado de volver.» Stephen King En una isla de las costas de Maine, un hombre es encontrado muerto. No hay identificación de su cuerpo. Solo el esforzado trabajo de un par de periodistas locales y de un graduado en medicina forense logra descubrir algunas pistas para, después de un año, saber quién es el muerto. Pero es aquí donde comienza el misterio. Porque cuanto más descubren del hombre y de las extrañas circunstancias de su muerte, menos comprenden. ¿Se trata de un crimen imposible? ¿O algo aún más extraño...? Con ecos de El halcón maltés de Dashiell Hammet y de la obra de Graham Greene, Stephen King presenta un relato sorprendente y conmovedor, cuyo tema es nada menos que la naturaleza del propio misterio.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=srS13AWstgIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2012-10-24",publisher:"DEBOLS!LLO",subtitle:e}},{id:1030,attributes:{title:g,description:"On an island off the coast of Maine, a man is found dead. There's no identification on the body. Only the dogged work of a pair of local newspapermen and a graduate student in forensics turns up any clues. But that's just the beginning of the mystery. Because the more they learn about the man and the baffling circumstances of his death, the less they understand. Was it an impossible crime? Or something stranger still...? No one but Stephen King could tell this story about the darkness at the heart of the unknown and our compulsion to investigate the unexplained. With echoes of Dashiell Hammett's The Maltese Falcon and the work of Graham Greene, one of the world's great storytellers presents a surprising tale that explores the nature of mystery itself...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Yrp-Eczh_gAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2005-10-04",publisher:"Simon and Schuster",subtitle:e}},{id:1031,attributes:{title:"Stephen King, American Master",description:"Fascinating facts, trivia, and little-known details about the Master of the Macabre’s life from the “world’s leading authority on Stephen King” (Entertainment Weekly). New York Times–bestselling author Stephen Spignesi has compiled interviews, essays, and loads of facts and details about all of Stephen King’s work into this fun and informative compendium for the author’s many fans, from the casual to the fanatical! Did you know. . . ? In his early teens, Stephen King sold typed copies of his short stories at school. King originally thought his novel Pet Sematary was too frightening to publish. King’s legendary Dark Tower series took him more than 30 years to write. Thinner was the novel that revealed his “Richard Bachman” pseudonym to the world. King wrote The Eyes of the Dragon for his daughter Naomi. He has never liked Stanley Kubrick’s film version of his novel The Shining. It took him four years to write what some consider his magnum opus, IT. The 2017 film version of IT has grossed more than $700 million worldwide. In addition to novels, King has written essays, plays, screenplays, and even poetry.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uMhyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Stephen Spignesi"],firstBook:b,published:"2018-10-30",publisher:"Permuted Press+ORM",subtitle:"A Creepy Corpus of Facts About Stephen King & His Work"}}]}}},meta:{}}},prerenderedAt:1681309104327}}("Stephen King",null,"series","movie","",1,"The Colorado Kid","Colorado Kid"))